import React from 'react';

export function Reservation({id, title, days, isPickUp, totalPrice, reservationEnd, bookType}){
    return(
        <li>
            <label>
                Reservation: {title}, {days}, {isPickUp}, {totalPrice}, {reservationEnd}, {bookType}
            </label>
        </li>
    );
}
